import Nft from '../../components/Nft'
import { useNoLayout } from '../../context'
import { useEffect, useState } from 'react'
export default function VaultPage(): JSX.Element {
  const [noLayout, setNoLayout] = useNoLayout()
  useEffect(() => {
    if (!noLayout) {
      setNoLayout(true)
    }
  }, [noLayout])
  return <Nft />
}
